import './MeasurementBox.css';

export default function MeasurementBox() {
    let name = "DC RMS";
    let channel = 2;
    let color = "#4caf50"
    let value = 123;
    let unit = "V";
    return (
        <div className="MeasurementBox">
            <div className="Name">{name}</div>
            <div class="Value">{value}{unit}</div>
        </div>
    );
}
